import AboutDiet from './AboutDiet';
class Contact extends Component {
    render(){
      return (
        <div className="ContactStyle">
          <h1 className="TitleName">Home Raised Cairns - Contact Information</h1>
       <form>
         <label> Dogs Are family </label>
         <br />
         <br />
         <label>Phone <br /> <a href="tel:5418199410">541.819.9410 </a></label>
         <br />
         <br />
         <label>Email <br /> <a href="mailto:homeraisedcairns@gmail.com"> HomeRaisedCairns@gmail.com </a></label>
        <br />
        <br />
        <label> This sites contact information is being updated often, thank you for your understanding and interest</label>

       </form>
        </div>

      ); 
    }
  }
  export default Contact;
